import React from 'react';
import styled from 'styled-components';
import { SvgIcon } from '@mui/material';
import DoneOutlineIcon from '@mui/icons-material/DoneOutline';

const Main = styled.main`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;

  button {
    border: none;
    padding: 0;
    color: black;
  }
`;

const JoinComplete = styled.div`
  width: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
  margin-top: 20rem;

  @media screen and (max-width: 600px) {
    margin-top: 15rem;
  }
`;

const JoinCompleteImage = styled.img`
  width: 7rem;
  margin: 1rem;

  @media screen and (max-width: 600px) {
    width: 5rem;
  }
`;

const JoinCompleteMsg1 = styled.p`
  font-size: 2rem;
  margin: 2rem;

  @media screen and (max-width: 600px) {
    font-size: 1.4rem;
    margin: 2rem 0 1.2rem 0;
  }
`;

const JoinCompleteMsg2 = styled.p`
  color: #9a9a9a;

  @media screen and (max-width: 600px) {
    font-size: 0.8rem;
  }
`;

const DefaultDiv = styled.div`
  margin: 1rem 0 3rem 0;
  width: 80%;
  display: flex;
  align-items: center;
  justify-content: center;
  height: 4rem;

  @media screen and (max-width: 600px) {
    margin-top: 0;
    margin-bottom: 1rem;
    height: 3rem;
  }
`;

const SelectDiv = styled(DefaultDiv)`
  margin-top: 3rem;
`;

const SelectButton = styled.button`
  background-color: #ffd651;
  border-radius: 10px;
  width: 50%;
  height: 4rem;
  display: inline-flex;
  align-items: center;
  justify-content: center;
  cursor: pointer;
  font-size: 1rem;

  &:hover {
    background-color: #f8cb37;
  }

  &.home-btn {
    margin-right: 0.5rem;
  }

  &.login-btn {
    margin-left: 0.5rem;
  }

  @media screen and (max-width: 600px) {
    width: 40vw;
    height: 12vw;
  }
`;

const JoinSuccess = () => {
  return (
    <Main>
      <JoinComplete>
        <JoinCompleteImage
          src="../svg/join-complete.svg"
          alt="join-complete"
        />
        <JoinCompleteMsg1>
          회원가입이 <b>완료</b> 되었습니다.
        </JoinCompleteMsg1>
        <JoinCompleteMsg2>
          로그인하시면 더욱 다양한 서비스를 이용 가능합니다.
        </JoinCompleteMsg2>
      </JoinComplete>
      <img src='../svg/back-btn.svg'/>
      <img src='../svg/detail-btn.svg'/>
      <img src='../svg/logo.svg'/>

      <SelectDiv>
        <SelectButton className="home-btn">
          <p>홈으로</p>
        </SelectButton>
        <SelectButton className="login-btn" onClick={() => (window.location.href = 'login')}>
          <p>로그인</p>
        </SelectButton>
      </SelectDiv>
    </Main>
  );
};

export default JoinSuccess;
